                <h3>As your Doula, I will work by your side as you prepare to give birth; present in each moment with a spirit of love and compassion. Whether you are interested in a home lactation consult or would like to work with me as your Doula, Iâ€™ll provide the emotional, educational and physical support you need not only during labor, but throughout your pregnancy and postpartum as well. We are a team and I've got your back.</h3>
            </section>
            <section className="events">
                <article>
                    <figure>
                        <figcaption></figcaption>
                    </figure>
                </article>
            </section>
        </main>
    )
}



export default Home;
